  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Banks Lake NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Banks Lake NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information about plan development and
  the management direction, and strategies for implementation. Key planning issues
  include: wildlife management, habitat management, resource protection, visitor services,
  and Refuge administration.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
